#include <iostream>
#include <vector>
#include <queue>
using namespace std;

struct point{
	int x;
	int y;
	point(int a, int b) :x(a), y(b){}
};

class Solution {
public:
	void solve(vector<vector<char> > &board)
	{
		if (board.size() == 0)
			return;
		int m = board.size(), n = board[0].size();
		vector<vector<bool> > index(m, vector<bool>(n, false));
		queue<char> q;
		for (int i = 0; i < m; i++){
			if (board[i][0] == 'O')
				bfs(i, 0, board, index);
			if (board[i][n - 1] == 'O')
				bfs(i, n - 1, board, index);
		}
		for (int j = 0; j < n; j++)
		{
			if (board[0][j] == 'O')
				bfs(0, j, board, index);
			if (board[m - 1][j] == 'O')
				bfs(m - 1, j, board, index);
		}
		for (int i = 0; i < m; i++)
			for (int j = 0; j < n; j++){
				if (board[i][j] == 'O')
					board[i][j] = 'X';
				if (board[i][j] == 'K')
					board[i][j] = 'O';
			}
	}
private:
	void bfs(int i, int j, vector<vector<char> > &board, vector<vector<bool> > &index)
	{
		queue<point> q;
		q.push(point(i, j));
		index[i][j] = true;
		while (!q.empty())
		{
			point p = q.front();
			q.pop();
			board[p.x][p.y] = 'K';
			if (p.x + 1 < board.size() && board[p.x + 1][p.y] == 'O' && !index[p.x + 1][p.y]){
				q.push(point(p.x + 1, p.y));
				index[p.x + 1][p.y] = true;
			}
			if (p.x - 1 >= 0 && board[p.x - 1][p.y] == 'O' && !index[p.x - 1][p.y]){
				q.push(point(p.x - 1, p.y));
				index[p.x - 1][p.y] = true;
			}
			if (p.y + 1 < board[0].size() && board[p.x][p.y + 1] == 'O' && !index[p.x][p.y+1]){
				q.push(point(p.x, p.y + 1));
				index[p.x][p.y+1] = true;
			}
			if (p.y - 1 >= 0 && board[p.x][p.y - 1] == 'O' && !index[p.x][p.y-1]){
				q.push(point(p.x, p.y - 1));
				index[p.x][p.y-1] = true;
			}
		}
	}
}S;
